import React, { useState } from "react";


function App() {
  const [date, setDate] = useState([
    {
      "id":1,"color":"red"
    },
    {
      "id":2,"color":"blue"
    }
  ])

  return(
    <div>
      <h1>{date.map(p => <h3>p.color</h3>)}</h1>
    </div>
  );
}

export default App;
